window.bookSummaryJSON = "<p><b>In the second gritty installment of the Raven's Mark series, a bounty hunter faces down the darkest evil.</b></p> <p>Ryhalt Galharrow is a blackwing - a bounty hunter who seeks out and turns over any man, woman, or child who has been compromised by the immortals known as the Deep Kings. Four years have passed since he helped drive the Deep Kings back across the Misery. But new and darker forces are rising against the republic....</p>"; 
